import React, { useEffect } from "react";
import { useLocation } from "react-router-dom";

function ViewEmployee() {
  const location = useLocation();
  const { employee } = location.state || {};

  useEffect(() => {
    if (employee) {
      console.log("Employee ID:", employee.empid);
      console.log("Employee Name:", employee.ename);
      console.log("Designation:", employee.designation);
      console.log("Joining Date:", employee.jdate);
      console.log("Status:", employee.status);
      // Print other details as needed
    }
  }, [employee]);

  if (!employee) {
    return <div>No employee data fd.</div>;
  }

  return (
    <div>
      <h2>Employee Details</h2>
      <p>Employee ID: {employee.empid}</p>
      <p>Name: {employee.ename}</p>
      <p>Designation: {employee.designation}</p>
      <p>Joining Date: {employee.jdate}</p>
      <p>Status: {employee.status}</p>
      {/* Add more details as needed */}
    </div>
  );
}

export default ViewEmployee;
